sourcesContent:
import db from '../models/index';
import { raw } from 'body-parser';
let getAllCategory = (req, res) => {
    return new Promise(async (resolve, reject) => {
        try {
            let categpries = db.Category.findAll({
                attributes: ['categoryId', 'nameCategory', 'iconName', 'createdAt', 'updatedAt'], // Ch nh r rng cc ct cn truy vn
                raw: true
            });
            resolve(categpries);
        } catch (error) {
            reject(error);
        }
    })

}

module.exports = {
    getAllCategory: getAllCategory
}

