sourcesContent:
import { where } from 'sequelize';
import db from '../models/index';

let getAllTeacher = () => {
    return new Promise(async (reslove, reject) => {
        try {
            let data = db.User.findAll({
                raw: true,
                where: {
                    typeUser: 0
                }
            })
            reslove(data)
        } catch (error) {
            reject(error)
        }
    })
}

module.exports = {
    getAllTeacher: getAllTeacher
}

